--
-- Table structure for table `tbl_employee`
--

DROP TABLE IF EXISTS `tbl_employee`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
 SET character_set_client = utf8mb4 ;
CREATE TABLE `tbl_employee` (
  `ccn_employee` int NOT NULL AUTO_INCREMENT,
  `ccn_type_id` int DEFAULT NULL,
  `number_id_employee` bigint NOT NULL,
  `first_name_employee` varchar(30) NOT NULL,
  `middle_name_employee` varchar(30) DEFAULT NULL,
  `first_last_name_employee` varchar(30) NOT NULL,
  `second_last_name_employee` varchar(30) DEFAULT NULL,
  `full_name_employee` varchar(200) NOT NULL,
  `date_birth_employee` date NOT NULL,
  `age` int NOT NULL,
  `age_range` int DEFAULT NULL,
  `auto_perceived_gender` int DEFAULT NULL,
  `rh` int DEFAULT NULL,
  `employee_personal_email` varchar(100) NOT NULL,
  `employee_personal_cellphone` varchar(40) NOT NULL,
  `informed_consent_law_1581` varchar(10) NOT NULL,
  `image` varchar(255) DEFAULT NULL,
  `employee_password` varchar(300) NOT NULL,
  `last_message_read_time` datetime DEFAULT NULL,
  `ccn_marital_status` int NOT NULL,
  PRIMARY KEY (`ccn_employee`),
  UNIQUE KEY `number_id_employee` (`number_id_employee`),
  KEY `auto_perceived_gender` (`auto_perceived_gender`),
  KEY `age_range` (`age_range`),
  KEY `ccn_type_id` (`ccn_type_id`),
  KEY `rh` (`rh`),
  KEY `ccn_marital_status` (`ccn_marital_status`),
  CONSTRAINT `tbl_employee_ibfk_1` FOREIGN KEY (`auto_perceived_gender`) REFERENCES `tbl_auto_perceived_gender` (`ccn_auto_perceived_gender`),
  CONSTRAINT `tbl_employee_ibfk_2` FOREIGN KEY (`age_range`) REFERENCES `tbl_age_range` (`ccn_age_range`),
  CONSTRAINT `tbl_employee_ibfk_3` FOREIGN KEY (`ccn_type_id`) REFERENCES `tbl_type_id` (`ccn_type_id`),
  CONSTRAINT `tbl_employee_ibfk_4` FOREIGN KEY (`rh`) REFERENCES `tbl_rh` (`ccn_rh`),
  CONSTRAINT `tbl_employee_ibfk_5` FOREIGN KEY (`ccn_marital_status`) REFERENCES `tbl_marital_status` (`ccn_marital_status`)
) ENGINE=InnoDB AUTO_INCREMENT=10006 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

