DROP TABLE IF EXISTS `tbl_employment_relationship`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
 SET character_set_client = utf8mb4 ;
CREATE TABLE `tbl_employment_relationship` (
  `ccn_employment_relationship` int NOT NULL AUTO_INCREMENT,
  `ccn_employee` int DEFAULT NULL,
  `ccn_role` int DEFAULT NULL,
  `ccn_work_shift` int DEFAULT NULL,
  `binding_date` datetime NOT NULL,
  `termination_date` datetime DEFAULT NULL,
  `time_worked` varchar(255) NOT NULL,
  `pending_days_to_enjoy_for_holidays` float DEFAULT NULL,
  `ccn_type_relationship` int DEFAULT NULL,
  `employee_corporate_email` varchar(100) NOT NULL,
  `employee_corporate_cellphone` bigint NOT NULL,
  `immediate_boss` int DEFAULT NULL,
  `manager` int DEFAULT NULL,
  `type_of_charge` varchar(50) NOT NULL,
  `is_active_employee` tinyint(1) DEFAULT NULL,
  `reason_for_disengagement` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`ccn_employment_relationship`),
  UNIQUE KEY `ccn_employee_2` (`ccn_employee`),
  KEY `ccn_role` (`ccn_role`),
  KEY `ccn_type_relationship` (`ccn_type_relationship`),
  KEY `ccn_work_shift` (`ccn_work_shift`),
  KEY `ccn_employee` (`ccn_employee`),
  KEY `immediate_boss` (`immediate_boss`),
  KEY `manager` (`manager`),
  CONSTRAINT `tbl_employment_relationship_ibfk_1` FOREIGN KEY (`ccn_role`) REFERENCES `tbl_roles` (`ccn_role`),
  CONSTRAINT `tbl_employment_relationship_ibfk_2` FOREIGN KEY (`ccn_type_relationship`) REFERENCES `tbl_type_relationship` (`ccn_type_relationship`),
  CONSTRAINT `tbl_employment_relationship_ibfk_3` FOREIGN KEY (`ccn_work_shift`) REFERENCES `tbl_work_shift` (`ccn_work_shift`),
  CONSTRAINT `tbl_employment_relationship_ibfk_4` FOREIGN KEY (`ccn_employee`) REFERENCES `tbl_employee` (`ccn_employee`),
  CONSTRAINT `tbl_employment_relationship_ibfk_5` FOREIGN KEY (`immediate_boss`) REFERENCES `tbl_employee` (`ccn_employee`),
  CONSTRAINT `tbl_employment_relationship_ibfk_6` FOREIGN KEY (`manager`) REFERENCES `tbl_employee` (`ccn_employee`)
) ENGINE=InnoDB AUTO_INCREMENT=154 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
