INSERT INTO `tbl_operative_performance_evaluation` VALUES (1,13,3,'80','50','80','80','80','50','80','100','100',700,'77.77777777777777','Me gusta el  trabajo que desempeo pues gracias a el he aprendido cosas nuevas me siento satisfecha   y cada da  le pido a dios por el bienestar de la  compaa y las personas que laboramos all  ','Formacion','2',NULL,'Formacion','3',NULL,'','0',NULL,'Formacin en Manejo de Alimentos.\nFormacin en Herramientas para la comunicacin Asertiva',NULL,1,NULL),(2,17,42,'100','100','80','80','100','80','100','100','100',840,'93.33333333333333','Durante mi desempeo en la compaa he logrado poner en practica todos mis conocimientos y de esta manera ayudar a la empresa en la organizacin de los almacenes. \nTambin he desempeado mis funciones de una forma responsable y organizada logrando corresponder con la confianza que se me ha brindado.  ','Supervision','3',NULL,'','0',NULL,'','0',NULL,'Cumple las tareas asignadas con responsabilidad, siempre con enfoque de ayudar la empresa, siguiendo procedimientos y colaborando a las dems reas ',NULL,1,NULL),(3,18,42,'100','100','80','100','100','100','100','80','100',860,'95.55555555555556','considero que soy un trabajador constante, efectivo, eficiente, me gusta desempear mis oficios de la mejor manera posible, tengo muy buenas habilidades para desempear las tareas que se me asignen.','Supervision','3',NULL,'','0',NULL,'','0',NULL,'Cumple inmediatamente con las tareas que se le asignan, siempre con la mejor intensin y en pro de mejora para la organizacin.\nPor mejorar la adaptacin al cambio.',NULL,1,NULL),(4,46,12,'100','80','80','100','80','80','100','80','50',750,'83.33333333333333','Mi compromiso con la empresa y productividad siempre trato de hacer lo mejor que puedo y procuro adaptarme a los cambios ','Reinduccion','4',NULL,'','0',NULL,'','0',NULL,'\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\nReinduccion acerca de la puntualidad y de las normas de la compaia en cuanto a normas y politica interna por parte del area de RRHH, y refuerzo acerca del no cumplimiento y nuestro derecho a realizar el debido proceso.\nCapacitacion en salud financiera\nCapacitacion en tecnicas de superacion personal  \n\n',NULL,1,NULL),(5,47,12,'100','80','100','100','100','100','100','80','80',840,'93.33333333333333',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL),(6,48,12,'100','80','100','100','100','80','100','100','100',860,'95.55555555555556','Gracias a la compaa por darme la oportunidad de llegar a ser lo que hoy soy: un trabajador con gran sentido de responsabilidad, y dispuesto a seguir el plan de trabajo y lograr con eficiencia las metas trazadas. Con iniciativa de seguir escalando dentro de la compaa. ','Formacion','1',NULL,'','0',NULL,'','0',NULL,'Capacitacion en salud financiera\nCapacitacion en tecnicas de superacion personal',NULL,1,NULL),(7,64,3,'80','50','80','80','80','80','80','80','100',710,'78.88888888888889','He mejorado 50% en mi desempeo laboral y la calificasion estoy de acuerdo y excelente jefe tengo y seguire mejorando','Formacion','2',NULL,'Formacion','3',NULL,'','0',NULL,'Capacitacin en Manejo de Alimentos.\nCapacitacin en Comunicacin Asertiva',NULL,1,NULL),(8,67,39,'80','80','80','100','100','100','100','80','50',770,'85.55555555555556','Mi desempeo durante este ao, ha sido de continuo aprendizaje buscando un mejoramiento continuo, bajo una organizacin y una participacin activa con el fin a una adaptacin al cambio y su vez buscando una mejora en la puntualidad como tambin en las relaciones internas. Lo anterior con el propsito de mostrar mis habilidades y capacidades que pueden aportar a la empresa, apoyando el logro de objetivos tanto del rea como de la misma compaa.','Supervision','4',NULL,'','0',NULL,'','0',NULL,'Como primer instancia se ha hecho retroalimentacin al trabajador para dar a conocer la importancia de cada uno de los criterios evaluados en el desempeo. Para trabajar en los tems a mejorar, se planea involucrar ms al trabajador en las actividades que se desarrollan en el proceso con el fin de que pueda reconocer la importancia de su rol y as mismo exigir que ella se esfuerce por mejorar y desenvolverse mejor en el ambiente laboral. La idea es poder llevar un seguimiento mensual y verificar que tan eficaz est siendo el plan de accin. ',NULL,1,NULL),(10,73,51,'80','50','80','100','80','80','50','50','100',670,'74.44444444444444','Agradezco la calificacin, buscar estrategias para mejorar los aspectos en cuanto a comunicacin. ','Formacion','3',NULL,'Supervision','3',NULL,'','0',NULL,'Se caracteriza por aprender y ejecutar de manera rpida las actividades que se deben realizar en el rea, demuestra inters y despeja las dudas de manera oportuna adems de ser una persona ordenada con documentacin y cronogramas de actividades. \nDebe fortalecer la comunicacin y participar de manera mas activa en las reuniones de rea. ',NULL,1,NULL),(11,74,46,'80','80','80','80','50','80','80','80','50',660,'73.33333333333333','Mi desempeo dentro de la compaa ha sido excelente doy lo mejor posible por ser ms organizado pero si la ingeniera no es organizada con las rdenes de trabajo yo no puedo comprometeme a ser ms organizado y lo de la puntualidad estoy en desacuerdo porque teniendo en cuenta que yo vivo en otro municipio y muchas de las veces uno est Excepto a que las mquinas presenten cualquier falla o obstculos en el camino para uno ser puntual en la empresa o a la compaa','Formacion','1',NULL,'','0',NULL,'','0',NULL,'Fomentar a los trabajadores la importancia de llegar a cualquier reunion 5 min antes a excepcin que halla un imprevisto no se tomara en cuenta, ayudarnos  con nuestro telefono con alarma ya que las distancias son largas por parte del grupo de ingenieria se avisara con anticipacin.',NULL,1,NULL),(12,75,56,'80','80','80','80','100','80','80','80','25',685,'76.11111111111111','Estoy deacuerdo con los porsentajes, ecepto con el de relaciones, ya que me concidero una persona que se lleva muy bien con mis compaeros y superiores. ','Formacion','2',NULL,'Plan de Desarrollo','3',NULL,'Supervision','4',NULL,'es una persona proactiva, servicial con sus compaeros posee amplio conocimiento en el rea de electricidad y mecnica falta enfocar  y mejorar un poco en la parte de control elctrico , servicial con los dems colaboradores y areas  es necesario mejorar en el tema de la puntualidad .','Un  tcnico que demuestra una actitud de querer aprender e innovar, debe estar ms enfocado al detalle ya que se han encontrado varas fallas por falta de cuidado, al igual que mejorar la puntualidad.  ',1,NULL),(13,76,56,'80','50','50','25','50','80','80','80','100',595,'66.11111111111111','Me siento confirme con ka calificacion ','Plan de Desarrollo','2',NULL,'Promocion','3',NULL,'','0',NULL,'es una persona muy proactiva en lo que hace, genera muy buenas ideas al equipo  se debe mejorar en la tcnica para algunos equipos en particular, es un tcnico con muchas habilidades y disposicin para aprender distintas diciplinas  ',NULL,1,NULL),(14,77,56,'50','80','80','25','100','50','100','100','80',665,'73.88888888888889','me comprometo a seguir aprendiendo, seguir ejerciendo mis conocimientos para mejorar los procesos, ser ms detallista en los trabajos ejecutados y cada vez superarme ms. ','Formacion','1',NULL,'Reinduccion','2',NULL,'Promocion','4',NULL,'es un colaborador dedicado en la parte administrativa , falta perfeccionar algunas habilidades  en la parte  elctrica , mecnica , tiene buena disposicin para  recibir retroalimentacin y feedback . es importante fortalecer las habilidades de compromiso y productividad.','El promedio de calificacin es el mismo, solo veo que se debe tener mejoras en Habilidades de comunicacin, organizacin y un poco en la puntualidad, y se le debe aumentar en 